const theme = {
    colors: {
        textPrimary: '#24292e',
        textSecondary: '#586069',
        primary: '#0366d6',
        white: '#fefefe'
    },
    fontSizes: {
        body: 14,
        subheading: 16
    },
    fonts: {
        main: 'System'
    },
    fontWeights: {
        normal: '400',
        bold: '700 '
    },
    background: {
        background: 'blue',
    },
    appBar: {
        primary: '#24292e',
        textPrimary: '#fff'
    }
}

export default theme
